import React from "react";
import MyLayout from "../../MyLayout";
import './index.css';

function HomeLayout(){

    
    return (
        <div className="homeWrapper">
           <section className="carrousel">
                <div className="carWrap">

                </div>
           </section>
           <section className="business">
            business
           </section>
           <section className="">
                dont'know yet
            </section>
        </div>
    )
}
export default function Home(){

    return (
        <>
            <MyLayout
                container={<HomeLayout/>}
            />
        </>
    )
}
